<div class="newsflash-item newsflash-1">
<div class="article-content">
<h3 class="newsflash-title articles">
				קצת עלינו			</h3>
<div class="newsflash-article">
<p dir="RTL">ראשית, תודה שהקדשתם את הזמן לגלוש לאתרנו ולבחון את שירות המוביל, עומר הובלות הינה חברת הובלות הפועלת בכל חלקי הארץ וקיימת למעלה מעשור.הצוות שלנו&nbsp; הוא צוות קבוע המורכב ע"י מובילים כחול לבן ועובד יחד כבר שנים.</p>
