<div class="newsflash-item newsflash-3">
<div class="article-content">
<h3 class="newsflash-title articles">
				המלצות אחרונות			</h3>
<div class="newsflash-article">
<!-- START: Modules Anywhere -->﻿﻿﻿
<div class="vb_lm_latest-messages">
<a href="/omer/recommend?messageId=15#vb15" title="Show message">
<div class="vb_lm_message ">
<div class="vb_lm_name">
                    אלינור					                </div>
<div class="vb_lm_text">
<p>היינו מאוד מרוצים, הם היו אחלה, כיף לעבוד עם הצוות של "עומר הובלות", נחמדים וחייכנים למרות העבודה הקשה, מקצוענים, עוטפים הכל בקפידה, מעבירים את הריהוט בזהירות, אכפת להם מהלקוח, עברתי המון דירות בחיי ומעולם לא קיבלתי שירות הובלה כזה מוצלח - ממליצה מכל הלב.</p>
</div>
<div class="vb_lm_date">
                        רביעי, 03 פברואר 2016 16:02                    </div>
</div>
</a>
</div>
<!-- END: Modules Anywhere -->
<p><a class="readmore" href="/omer/recommend?view=vitabook">לכל ההמלצות</a></p>			</div>
</div>
</div>
