<section id="center-bottom">
<div class="moduletable video-box">
<h3 class="module-title ">
<span class='hfirst'>עומר</span><span class='hnext'> הובלות - הובלות לכל חלקי הארץ</span>
</h3>
<div class="custom video-box"  >
<p dir="RTL">כדי לחסוך לכם זמן יקר ובעיקר גם לאפשר לכם הובלה מקצועית ובאיכות הגבוהה ביותר, אנו בחברת עומר הובלות מציעים לכם מגוון אפשרות של שירותי אריזה מקצועיים. רגע לפני הובלה של תכולת הבית או משרד שלכם, נשלך אליכם צוות מקצועי ומנוסה אשר יארוז את הציוד שלכם על פי הנדרש כבר לאחר פגישה ראשונית ולא מחייבת אתם מיד תקבלו את הביטחון הדרוש לצורך הובלת הציוד / התכולה שלכם.</p>
<p dir="RTL">כמו כן חברת עומר הובלות נוסדה בשלהי שנות ה-2000,&nbsp;ומאז היא מספקת שירותי הובלות ברחבי הארץ.צוות עובדים שלנו קבוע המחויב לאיכות,מקצוענות ואדיבות<span dir="LTR">.&nbsp;</span>אנחנו מומחים בהעברת דירות, בתים, חברות ומפעלים<span dir="LTR">.</span></p>
<p dir="RTL">בזכות הצוות הקבוע והוותיק יש בינינו תיאום מושלם ושיתוף פעולה הדוק שמאפשר לנו להוביל את הרכוש ביעילות ובמהירות מתוך שמירה קפדנית על שלמותו ותקינותו. לחברת הובלות זאת יש רישיון מוביל ומוביל מורשה מטעם משרד התחבורה<span dir="LTR">.</span></p>
<p dir="rtl">כל אחד מצוות עובדי החברה מתמחה בפעילות אחרת ומיומן בהפעלת ציוד בתחום עיסוקו. כגון:</p>
<ul dir="rtl">
<li>נגרים מיומנים שיודעים לפרק ולהרכיב מחדש כל דבר</li>
<li>אנשי שירות המטפלים באדיבות בפניות לקוחותינו</li>
</ul>
<p dir="rtl">חברת עומר מאמינה בשירות אישי, אמין ומקצועי וכל זאת תוך שמירה על הסטנדרטים הגבוהים ביותר.</p>
<p dir="RTL">אנחנו רוצים להזמין אותך לשיחת יעוץ לא מחייבת, צרו איתנו קשר בטל 050-7562288</p></div>
</div>
